import "./index.css";
const DiseasesCard = (props) => {
  const { backToDiseasesPage, cardDetails } = props;
  const { heading, description, treatment, tips, Symptoms } = cardDetails;
  const onclickButton = () => {
    backToDiseasesPage();
  };
  return (
    <div className="disease-card-conatiner">
      <h1 className="main-heading">{heading}</h1>
      <div className="inner-container">
        <div className="left-conatiner">
          <video width="100%" controls autoPlay loop muted>
            <source
              src="https://www.w3schools.com/html/mov_bbb.mp4"
              type="video/mp4"
            />
          </video>
          <img
            className="disease-image"
            alt="disease-image"
            src="https://i.pinimg.com/736x/8d/1a/7e/8d1a7e55b3b4c5a551d4ad7a920a6ded.jpg"
          />
          <p className="heading">Symptoms:</p>
          <ul>
            {Symptoms.map((symptom, index) => (
              <li key={index}>{symptom}</li>
            ))}
          </ul>
        </div>
        <div className="right-container">
          <h1 className="heading">Description</h1>
          <p className="decription">{description}</p>
          <h1 className="heading">Treatment </h1>
          <p className="decription">{treatment}</p>
          <h1 className="heading">Tips & Suggestions:</h1>
          <ul className="decription">
            {tips.map((tip, index) => (
              <li key={index}>{tip}</li>
            ))}
          </ul>
        </div>
      </div>
      <div className="btn-container">
        <button className="back-button" type="button" onClick={onclickButton}>
          Back
        </button>
      </div>
    </div>
  );
};

export default DiseasesCard;
